# simply gets a pandas dataFrame and the aligned predictions and write them to the grid (in "looking_for" list we can see which features we decided to include)
def write_to_grid(smple_pandas,preds):

    fields = {}
    looking_for = ['age','comp1sum','comp2sum','comp3sum','comp4sum','error1sum_rollingmean_24','error2sum_rollingmean_24','error3sum_rollingmean_24','error4sum_rollingmean_24','error5sum_rollingmean_24','machineID']#,'model']
    for idx,value in  enumerate(smple_pandas):
        if value in looking_for:
            fields[value]=idx


    aa = sorted(fields.keys())
    print aa



    for (row,value),pred in  zip(smple_pandas.iterrows(),preds) :
        temp_list = []
        for i in aa :
            temp_list.append(float(value[i]))
        temp_list[0]=int(temp_list[0])
        temp_list[-1]=int(temp_list[-1])
        temp_list.append(pred)
        print temp_list
        newRow = spark.createDataFrame([temp_list], scheme)
        newRow.write.format("org.apache.spark.sql.insightedge").mode("append").save("model.v1.PM")




