    #fedata = spark.read.parquet("/home/or/Desktop/final_proj/gigaspaces-insightedge-enterprise-14.5.0-m7/insightedge/data/mini30"+FE_DIRECTORY)
    fp = fedata.toPandas()



    my_index = []

    for idx,(value,line) in enumerate(fp.iterrows()) :
        flag = 0
        for i in line:
            if i == None :
                flag=1

        if flag == 1:
            my_index.append(idx)



    fp = fp.drop(my_index)    
